import React from 'react';
import './Feedbacksubmitted.css'; // Import the CSS file

function FSubmitted() {
  return (
    <div className="center-images">
      <img src="../images/ty_feedback.png" alt="Submitted" />
    </div>
  );
}

export default FSubmitted;
